package contest

import (
	"fmt"
	"sort"
	"testing"

	"github.com/stretchr/testify/assert"
)

type sol struct {
	i int
	v []int
}

type sols []sol

func kWeakestRows(mat [][]int, k int) []int {
	m := len(mat)
	s := make(sols, m)
	for i := 0; i < m; i++ {
		s[i] = sol{
			i: i,
			v: mat[i],
		}
	}
	sort.Slice(s, func(i, j int) bool {
		for idx, n := 0, len(s[i].v); idx < n; idx++ {
			if s[i].v[idx] == s[j].v[idx] {
				continue
			}
			return s[i].v[idx] < s[j].v[idx]
		}
		return s[i].i < s[j].i
	})
	res := make([]int, k)
	for i := 0; i < k; i++ {
		res[i] = s[i].i
	}
	return res
}

